<pre><code>[{
  _id:ObjectId(&quot;...&quot;),
  subjects:[
     {
         subjectId: ObjectId(&quot;1&quot;)
         name: &quot;Physics&quot;,
         marksObtained:80,
         rank:0
     },
     {
         subjectId: ObjectId(&quot;2&quot;)
         name: &quot;Chemistry&quot;,
         marksObtained:70,
         rank:0
     },
     {
         subjectId: ObjectId(&quot;3&quot;)
         name: &quot;Maths&quot;,
         marksObtained:80,
         rank:0
     }
  ]
}...]
</code></pre>
<p>Now, I am trying to increase rank in Maths of everyone with marks less than 90. For this, I am using the following query:</p>
<pre><code>db.getCollection('test_attempts').updateMany({
    &quot;subjects.subjectId&quot;: ObjectId(&quot;3&quot;),
    &quot;subjects.marksObtained&quot;:{$lt:90}
  },
  {
    $inc: {
      &quot;subjects.$.rank&quot;: 1
  }
});
</code></pre>
<p>This code updates the rank of physics object instead of maths if physics has marksObtained less than 90. At the subject Physics has marks over 90, it updates the object of Chemistry.</p>
<p>Somehow its ignoring subjectId in the query and updating the first object of the array with matching marksObtained condition.</p>
<p>Not sure what I am doing wrong.</p>
<p>P.S. ObjectIds in subjects are for representational purpose only.</p>

