Dealing with race conditions and starvation when generating unique IDs using MongoDB + NodeJS<p>I am using MongoDB to generate unique IDs of this format:</p>
<p><code>{ID TYPE}{ZONE}{ALPHABET}{YY}{XXXX}</code></p>
<p>Here <code>ID TYPE</code> will be an alphabet from <code>{U, E, V}</code> depending on the input, zone will be from the set <code>{N, S, E, W}</code>, <code>YY</code> will be the last 2 digits of the current year and <code>XXXXX</code> will be a 5 digit number beginning from 0 (willbe padded with 0s to make it 5 digits long). When <code>XXXXX</code> reaches <code>99999</code>, the <code>ALPHABET</code> part will be incremented to the next alphabet (starting from A).</p>
<p>I will receive <code>ID TYPE</code> and <code>ZONE</code> as input and will have to give the generated unique ID as output. Everytime, I have to generate a new ID, I will read the last generated for the given <code>ID TYPE</code> and <code>ZONE</code>, increment the number part by 1 (XXXXX + 1) and then save the new generated ID in MongoDB and return the output to the user.</p>
<p>This code will be run on a single NodeJS server and there can be multiple clients calling this method
Is there a possibility of a race condition like the once described below if I am ony running a single server instance:</p>
<ol>
<li>First client reads last generated ID as <code>USA2100000</code></li>
<li>Second client reads last generated ID as <code>USA2100000</code></li>
<li>First client generates the new ID and saves it as <code>USA2100001</code></li>
<li>Second client generates the new ID and saves it as <code>USA2100001</code></li>
</ol>
<p>Since 2 clients have generated IDs, finally the DB should have had <code>USA2100002</code>.</p>
<p>To overcome this, I am using MongoDB transactions. My code in Typescript using Mongoose as ODM is something like this:</p>
<pre><code>      session = await startSession();
      session.startTransaction();
      lastId = await GeneratedId.findOne({ key: idKeyStr }, &quot;value&quot;).value
      lastId = createNextId(lastId); 
      const newIdObj: any = {
        key: `Type:${idPrefix}_Zone:${zone_letter}`,
        value: lastId,
      };
      await GeneratedId.findOneAndUpdate({ key: idKeyStr }, newIdObj, {
        upsert: true,
        new: true,
      });
      await session.commitTransaction();
      session.endSession();
</code></pre>
<ol>
<li>I want to know what exactly will happen when the situation I
described above happens with this code?</li>
<li>Will the second client's transaction throw an exception and I have to abort or retry the transaction in my code or will it handle the retry on its own?</li>
<li>How does MongoDB or other DBs handle transactions? Does MongoDB lock the documents involved in the transaction? Are the exclusive locks (wont even allow other clients to read)?</li>
<li>If the same client keeps failing to commit its transaction, this client would be starved. How to deal with this starvation?</li>
</ol>

